import React from 'react';
import UrlForm from '../components/UrlForm';
import UrlList from '../components/UrlList';

const Home = () => {
    return (
        <div>
            <h1>URL Shortener</h1>
            <UrlForm />
            <UrlList />
        </div>
    );
};

export default Home;
